{{info}}
The images and documentation below feature the new Users and Groups Management UI available since XWiki Enterprise 1.2 and beyond.
{{/info}}

The new interface provides easy management of the groups and users. They are displayed in a dynamically loaded table, thus requesting less time to load than if all the users and groups would have been loaded all at once. Click on the small icons next to each user and group in the table to edit or remove them. You can filter the users and groups name as you type, using the input filters provided by the interface.

= Manage users =

Please visit the [[User Management Guide>>AdminGuide.User Management]] for detailed guidance on how to manage the users in your wiki.

